    x233 = np.zeros((nbos, nbos, nocc, nvir), dtype=np.float64)
    x233 += einsum("WVBp,poAB->VWoA", lu12, x219)
    del x219
    lu12new += einsum("poAB,WVpB->VWAo", x116, x233)
