    x33 += einsum("jied->ijde", t2) * 2
    x36 += einsum("ej,jied->id", l1, x33) * -1
    del x33
    x36 += einsum("id->id", t1) * -1
    x36 += einsum("u,uid->id", ls1, u11) * -1
    x36 += einsum("vu,vuid->id", ls2, u12) * -0.5
    rdm_eb_des_ov += einsum("u,id->uid", s1, x36) * -2
