    x37 = np.zeros((nbos, nbos, nocc, nvir), dtype=np.float64)
    x37 += einsum("vuid->uvid", u12)
    x37 += einsum("vu,id->uvid", s2, t1)
    rdm_eb_des_ov -= einsum("ved,vuie->uid", x5, x37) * 2
